import { useParams } from "react-router-dom";
import Layout from "./Layout";

export default function Movie() {
  let params = useParams();
  console.log(params);
  return (
    <Layout>
      <h2>Who are we?</h2>
      <p>That feels like an existential question, don't you think?</p>
    </Layout>
  );
}
